INSERT INTO `site` (`site_id`, `site_name`, `site_title`, `site_desc`, `site_social_title`, `site_social_desc`, `site_social_image`, `site_content`, `site_image`, `site_insert`, `site_update`, `site_status`, `site_lock`, `site_type`) VALUES
(1, 'Công trình dự án', 'VỚI CHÚNG TÔI TÍNH MẠNG CON NGƯỜI VÀ SỰ AN TOÀN TẤT CẢ.', 'Hiện nay chung tôi đang tiến hành các công trình:\r\n+ Cty TNHH Tín Thảo.\r\n+ Công Ty TNHH Count Vina.\r\n+ ...', 'THÔNG TIN LIÊN HỆ', '', '/data/image/color/1x1.jpg', '<p><span style=\"color:rgb(102, 102, 102); font-family:myriadproregular,sans-serif; font-size:13px\">Tuy tuổi đời c&ograve;n trẻ, nhưng ch&uacute;ng t&ocirc;i đ&atilde; trở th&agrave;nh đối t&aacute;c đ&aacute;ng tin cậy cho c&aacute;c c&ocirc;ng ty trong v&agrave; ngo&agrave;i nước lựa chọn l&agrave;m nh&agrave; thầu cho c&aacute;c c&ocirc;ng tr&igrave;nh của họ, với mức độ tin tưởng tuyệt đối. Ch&uacute;ng t&ocirc;i lu&ocirc;n ho&agrave;n th&agrave;nh tốt c&aacute;c c&ocirc;ng việc của m&igrave;nh, khi mỗi một c&ocirc;ng tr&igrave;nh được nhiệm thu đều l&agrave; một niềm vui khi những th&agrave;nh quả m&agrave; ch&uacute;ng t&ocirc;i đ&oacute;ng g&oacute;p đem lại sự h&agrave;i l&ograve;ng cho kh&aacute;c h&agrave;ng cũng như những người sử dụng c&aacute;c c&ocirc;ng tr&igrave;nh đ&oacute;. V&agrave; ch&uacute;ng t&ocirc;i lu&ocirc;n đặt tr&aacute;ch nhiệm v&agrave; sự an to&agrave;n l&ecirc;n h&agrave;ng đầu, bởi với ch&uacute;ng t&ocirc;i t&iacute;nh mạng con người lu&ocirc;n tr&aacute;ch nhiệm cao nhất mỗi khi bắt tay v&agrave;o khởi c&ocirc;ng cho một dự &aacute;n.</span></p>\n', '/assets/nha-dat/img/bg2.jpg', '2014-09-29 13:59:37', '2015-06-09 11:30:03', 'true', 'true', ''),
(2, 'Khách hàng quan tâm', 'VỚI CHÚNG TÔI TÍNH MẠNG CON NGƯỜI VÀ SỰ AN TOÀN TẤT CẢ.', 'Hiện nay chung tôi đang tiến hành các công trình:\r\n+ Cty TNHH Tín Thảo.\r\n+ Công Ty TNHH Count Vina.\r\n+ ...', 'Creative Design Studio', 'Creative Design to be part of the SELFKISS Project.\r\nCREATIVE DIRECTION : Creative Design.\r\nPHOTOGRAPHY : Creative Design.\r\nPOST-PRODUCTION : Creative Design.\r\nDATE : 2014', '/data/image/color/1x1c.jpg', '<span style=\"color:rgb(102, 102, 102); font-family:myriadproregular,sans-serif; font-size:13px\">Tuy tuổi đời c&ograve;n trẻ, nhưng ch&uacute;ng t&ocirc;i đ&atilde; trở th&agrave;nh đối t&aacute;c đ&aacute;ng tin cậy cho c&aacute;c c&ocirc;ng ty trong v&agrave; ngo&agrave;i nước lựa chọn l&agrave;m nh&agrave; thầu cho c&aacute;c c&ocirc;ng tr&igrave;nh của họ, với mức độ tin tưởng tuyệt đối. Ch&uacute;ng t&ocirc;i lu&ocirc;n ho&agrave;n th&agrave;nh tốt c&aacute;c c&ocirc;ng việc của m&igrave;nh, khi mỗi một c&ocirc;ng tr&igrave;nh được nhiệm thu đều l&agrave; một niềm vui khi những th&agrave;nh quả m&agrave; ch&uacute;ng t&ocirc;i đ&oacute;ng g&oacute;p đem lại sự h&agrave;i l&ograve;ng cho kh&aacute;c h&agrave;ng cũng như những người sử dụng c&aacute;c c&ocirc;ng tr&igrave;nh đ&oacute;. V&agrave; ch&uacute;ng t&ocirc;i lu&ocirc;n đặt tr&aacute;ch nhiệm v&agrave; sự an to&agrave;n l&ecirc;n h&agrave;ng đầu, bởi với ch&uacute;ng t&ocirc;i t&iacute;nh mạng con người lu&ocirc;n tr&aacute;ch nhiệm cao nhất mỗi khi bắt tay v&agrave;o khởi c&ocirc;ng cho một dự &aacute;n.</span>', '/assets/nha-dat/img/bg2.jpg', '2014-09-29 14:28:18', '2015-06-09 11:29:56', 'true', '1', ''),
(3, 'POST-PRODUCTION : Creative Design.', 'Creative Design Studio - Printing Design', 'Creative Design to be part of the SELFKISS Project.\r\nCREATIVE DIRECTION : Creative Design.\r\nPHOTOGRAPHY : Creative Design.\r\nPOST-PRODUCTION : Creative Design.\r\nDATE : 2014', 'Creative Design Studio - Printing Design', 'Creative Design to be part of the SELFKISS Project.\r\nCREATIVE DIRECTION : Creative Design.\r\nPHOTOGRAPHY : Creative Design.\r\nPOST-PRODUCTION : Creative Design.\r\nDATE : 2014', '/data/image/bg/film-bg.jpg', '', 'http://1109.com/assets/Video/img/temp/background-audio.jpg', '2014-09-30 08:41:42', '2015-04-05 10:53:12', 'true', '1', ''),
