(39, 'GIẢI ĐÁP TRẢ LỜI TƯ VẤN KHÁCH HÀNG', 'CUSTOMER SERVICE', 'Hãy liên hệ với chúng tôi theo hotline khi bạn có bất kì thắc mắc hoặc những vấn đề phân vân cần tư vấn. Chúng tôi sẽ  lắng nghe và giải đáp mọi thắc mắc giúp bạn bất cứ lúc nào', 'Please contact us on our hotline if you have any questions or problems need counseling. We will listen and answer any questions to help you anytime.', '/assets/nha-dat/img/lh.jpg', '/assets/nha-dat/img/bg2.jpg', 'H&atilde;y li&ecirc;n hệ với ch&uacute;ng t&ocirc;i theo hotline khi bạn c&oacute; bất k&igrave; thắc mắc hoặc những vấn đề ph&acirc;n v&acirc;n cần tư vấn. Ch&uacute;ng t&ocirc;i sẽ lắng nghe v&agrave; giải đ&aacute;p mọi thắc mắc gi&uacute;p bạn.', 'Please contact us on our hotline if you have any questions or problems need counseling. We will listen and answer any questions to help you.', '2015-06-09 15:57:12', '2015-08-03 11:13:50', 'true', 'pri-event', NULL, 'CÁC KHÁCH HÀNG LIÊN HỆ VỚI CHÚNG TÔI', 'CONTACT US', 0, '2015-01-01 00:00:00', '2010-01-01 00:00:00', 'Liên Hệ', 'CONTACT'),
