(30, 'Dịch vụ tư vấn', NULL, '2015-04-15 10:00:28', '2015-04-15 10:06:59', '2015-04-15 09:58:38', 'true', '<div>Nội dung dịch vụ tư vấn th&agrave;nh lập doanh nghiệp:</div>\r\n\r\n<div>1. Tư vấn trước khi Th&agrave;nh lập doanh nghiệp:</div>\r\n\r\n<div>- Tư vấn lựa chọn loại h&igrave;nh C&ocirc;ng ty;</div>\r\n\r\n<div>- Tư vấn về t&ecirc;n của doanh nghiệp;</div>\r\n\r\n<div>- Tư vấn trụ sở ch&iacute;nh của doanh nghiệp;</div>\r\n\r\n<div>- Tư vấn về vốn điều lệ v&agrave; vốn ph&aacute;p định;</div>\r\n\r\n<div>- Tư vấn về ng&agrave;nh nghề kinh doanh;</div>\r\n\r\n<div>- Tư vấn về c&aacute;c s&aacute;ng lập vi&ecirc;n v&agrave; đại diện theo ph&aacute;p luật của doanh nghiệp;</div>\r\n\r\n<div>- Lập hồ sơ th&agrave;nh lập doanh nghiệp;</div>\r\n\r\n<div>2. Thực hiện c&aacute;c c&ocirc;ng việc theo uỷ quyền:</div>\r\n\r\n<div>- Đại diện cho kh&aacute;ch h&agrave;ng nộp, r&uacute;t, khiếu nại, nhận hồ sơ đăng k&yacute; kinh doanh tại Ph&ograve;ng đăng k&yacute; kinh doanh;</div>\r\n\r\n<div>- Tiến h&agrave;nh thủ tục xin cấp dấu cho Doanh nghiệp;</div>\r\n\r\n<div>- Tiến h&agrave;nh thủ tục đăng k&yacute; m&atilde; số thuế v&agrave; chức năng xuất nhập khẩu cho doanh nghiệp.</div>\r\n\r\n<div>3. Tư vấn sau khi Doanh nghiệp được th&agrave;nh lập:</div>\r\n\r\n<div>- Tư vấn c&aacute;c c&ocirc;ng việc cần v&agrave; phải l&agrave;m của một doanh nghiệp mới;</div>\r\n\r\n<div>- Tư vấn c&aacute;c vấn đề li&ecirc;n quan đến doanh nghiệp trong qu&aacute; tr&igrave;nh hoạt động (qua email, thư, fax);</div>\r\n\r\n<div>- Miễn ph&iacute; cung cấp văn bản ph&aacute;p luật theo y&ecirc;u cầu;</div>\r\n\r\n<div>- Soạn thảo hồ sơ nội bộ của doanh nghiệp, gồm: Điều lệ doanh nghiệp; Bi&ecirc;n bản g&oacute;p vốn th&agrave;nh lập C&ocirc;ng ty, bầu chủ tịch, cử người đại diện theo ph&aacute;p luật; Quyết định bổ nhiệm Gi&aacute;m đốc; Quyết định bổ nhiệm kế to&aacute;n trưởng; Chứng nhận sở hữu vốn; Sổ v&agrave; th&ocirc;ng b&aacute;o lập sổ cổ đ&ocirc;ng/th&agrave;nh vi&ecirc;n&hellip;</div>\r\n\r\n<div>Để th&agrave;nh thuận tiện cho việc tư vấn th&agrave;nh lập doanh nghiệp, qu&yacute; vị chỉ cần cung cấp th&ocirc;ng tin theo mẫu n&agrave;y v&agrave; gửi lại cho ch&uacute;ng t&ocirc;i theo một trong c&aacute;c email c&oacute; tr&ecirc;n website n&agrave;y. Đừng ngần ngại li&ecirc;n lạc với ch&uacute;ng t&ocirc;i nếu qu&yacute; kh&aacute;ch đang c&oacute; nhu cầu tư vấn th&agrave;nh lập C&ocirc;ng ty hoặc c&aacute;c thắc mắc li&ecirc;n quan đến việc khởi nghiệp hay c&aacute;c y&ecirc;u cầu cung cấp dịch vụ ph&aacute;p l&yacute; kh&aacute;c.</div>\r\n\r\n<div>Lĩnh vực Doanh nghiệp li&ecirc;n quan:</div>\r\n\r\n<div>&nbsp;&gt;&gt; Xin giấy ph&eacute;p tư vấn du học</div>\r\n\r\n<div>&nbsp;&gt;&gt; &nbsp;Giải thể C&ocirc;ng ty TNHH 2 th&agrave;nh vi&ecirc;n trở l&ecirc;n</div>\r\n\r\n<div>&nbsp;&gt;&gt; Giải thể c&ocirc;ng ty cổ phần</div>\r\n\r\n<div>&nbsp;&gt;&gt; Tư vấn họp Hội đồng quản trị</div>\r\n\r\n<div>&nbsp;&gt;&gt;Tư vấn họp Hội đồng th&agrave;nh vi&ecirc;n</div>\r\n\r\n<div>&nbsp;&gt;&gt; Tư vấn ph&aacute;t h&agrave;nh cổ phần ri&ecirc;ng lẻ</div>\r\n\r\n<div>&nbsp;&gt;&gt; Tư vấn th&agrave;nh lập tập đo&agrave;n kinh tế</div>\r\n\r\n<div>&nbsp;&gt;&gt; Dịch vụ tư vấn giải thể chi nh&aacute;nh</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>H&atilde;y nhấc m&aacute;y gọi số 0908 472 677 để được sử dụng dịch vụ tư vấn luật tốt nhất.</div>\r\n\r\n<div>C&ocirc;ng ty ch&uacute;ng t&ocirc;i lu&ocirc;n c&oacute; đội ngũ luật sư giỏi, uy t&iacute;n, v&agrave; c&oacute; t&iacute;nh chuy&ecirc;n nghiệp, t&iacute;nh quốc tế cao. Để đ&aacute;p ứng đầy đủ y&ecirc;u cầu của kh&aacute;ch h&agrave;ng.</div>\r\n', NULL, 'tag', NULL, NULL, 0, 'Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.', 'service', NULL, 2, NULL, 0, 0, 'dich-vu-tu-van', '', NULL, NULL),
