(40, 'Ưu đãi hấp dẫn, chỉ từ 540 triệu đã có thể sở hữu căn hộ Park 5', NULL, '2015-06-08 20:13:36', '2019-02-28 14:24:27', '2015-06-08 20:12:47', 'true', '<div class=\"detailsView-contents-style detail-article-content\" id=\"divContents\" style=\"font-family: Tahoma; margin: 10px 0px 0px; padding: 0px; height: auto; word-wrap: break-word; text-align: justify; line-height: 18px; text-rendering: optimizeLegibility; color: rgb(0, 0, 0);\">\r\n<table align=\"center\" style=\"border:0px; margin:auto; vertical-align:middle; width:250px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:middle\"><img alt=\"phối cảnh dự án\" src=\"http://file4.batdongsan.com.vn/2015/06/04/wxbwknn6/20150604170346-9828.jpg\" style=\"height:270px; margin:0px; padding:0px; width:480px\" title=\"Ưu đãi hấp dẫn, chỉ từ 540 triệu đã có thể sở hữu căn hộ Park 5 \" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle\"><em>Phối cảnh Park 5</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Kh&ocirc;ng &iacute;t c&aacute;c ng&acirc;n h&agrave;ng đ&atilde; nhanh tay kết hợp với c&aacute;c chủ đầu tư đưa ra c&aacute;c ưu đ&atilde;i vay vốn gi&aacute; tốt để khuyến kh&iacute;ch kh&aacute;ch h&agrave;ng mạnh dạn mua nh&agrave;. Những &ldquo;c&uacute; bắt tay&rdquo; kh&ocirc;n ngoan như vậy kh&ocirc;ng chỉ gi&uacute;p biến ước mơ c&oacute; nh&agrave; H&agrave; Nội của nhiều người trở th&agrave;nh hiện thực m&agrave; c&ograve;n gi&uacute;p ng&acirc;n h&agrave;ng đẩy mạnh việc giải ng&acirc;n g&oacute;i t&iacute;n dụng nh&agrave; ở. Điển h&igrave;nh trong sự kết hợp n&agrave;y l&agrave; sự bắt tay giữa đại gia BĐS Vingroup v&agrave; Ng&acirc;n h&agrave;ng Techcombank đối với g&oacute;i t&iacute;n dụng cho t&ograve;a căn hộ đẳng cấp Park 5 tại Vinhomes Times City &ndash; Park Hill.</p>\r\n\r\n<p>Ch&iacute;nh s&aacute;ch ưu đ&atilde;i vay mua căn hộ Park 5 đang được giới am hiểu t&agrave;i ch&iacute;nh v&agrave; kh&aacute;ch h&agrave;ng đ&aacute;nh gi&aacute; rất cao. Ch&iacute;nh s&aacute;ch n&agrave;y mở ra cơ hội sở hữu nh&agrave; ở cho nhiều người v&agrave; khuyến kh&iacute;ch một lượng lớn kh&aacute;ch h&agrave;ng sử dụng nguồn vốn ng&acirc;n h&agrave;ng để mua căn hộ thay v&igrave; sử dụng vốn c&aacute; nh&acirc;n.</p>\r\n\r\n<p>Cụ thể, kh&aacute;ch h&agrave;ng chỉ cần vốn tự c&oacute; 30% gi&aacute; trị căn hộ, song song, ng&acirc;n h&agrave;ng Techcombank sẽ hỗ trợ vay tới 70% gi&aacute; trị căn hộ để kh&aacute;ch h&agrave;ng thanh to&aacute;n sớm đến 100% gi&aacute; trị căn hộ với rất nhiều ưu đ&atilde;i như:</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;CĐT hỗ trợ l&atilde;i suất 0%/năm cho 70% gi&aacute; trị căn hộ, trong thời gian từ thời điểm giải ng&acirc;n thanh to&aacute;n sớm đến thời điểm thanh to&aacute;n từng đợt theo tiến độ ban đầu tr&ecirc;n HĐMB</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;Ng&acirc;n h&agrave;ng tặng tiền mặt số tiền bằng 3%/năm cho 70% gi&aacute; trị căn hộ, trong thời gian từ thời điểm giải ng&acirc;n sớm đến thời điểm thanh to&aacute;n từng đợt theo tiến độ ban đầu tr&ecirc;n HĐMB. Số tiền tặng lại n&agrave;y l&ecirc;n tới 2% tổng gi&aacute; trị căn hộ.</p>\r\n\r\n<p>-&nbsp;&nbsp; &nbsp;&Acirc;n hạn gốc v&agrave; miễn ph&iacute; trả nợ trước hạn trong v&ograve;ng 24 th&aacute;ng kể từ ng&agrave;y giải ng&acirc;n sớm.</p>\r\n\r\n<p>Như vậy, chỉ cần c&oacute; 30% vốn tự c&oacute;, kh&aacute;ch h&agrave;ng c&oacute; thể sở hữu ngay căn hộ Park 5 m&agrave; kh&ocirc;ng phải lo thanh to&aacute;n gốc trong v&ograve;ng 24 th&aacute;ng.</p>\r\n\r\n<table align=\"center\" style=\"border:0px; margin:auto; vertical-align:middle; width:250px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:middle\"><img alt=\"dự án bđs\" src=\"http://file4.batdongsan.com.vn/2015/06/04/wxbwknn6/20150604170346-87a9.jpg\" style=\"height:269px; margin:0px; padding:0px; width:480px\" title=\"Ưu đãi hấp dẫn, chỉ từ 540 triệu đã có thể sở hữu căn hộ Park 5 1\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle\"><em>S&acirc;n thể thao</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, Techcombank cũng sẽ đồng h&agrave;nh c&ugrave;ng CĐT cam kết thực hiện nghĩa vụ b&agrave;n giao nh&agrave; đ&uacute;ng tiến độ như quy định tại HĐMB, n&ecirc;n kh&aacute;ch h&agrave;ng c&oacute; thể ho&agrave;n to&agrave;n y&ecirc;n t&acirc;m về việc c&oacute; thể nhận b&agrave;n giao nh&agrave; v&agrave;o đầu năm 2017.</p>\r\n\r\n<p>Cả 2 vợ chồng chị Đỗ Thị Hồng (Quận Hai B&agrave; Trưng, H&agrave; Nội) đều l&agrave; nh&acirc;n vi&ecirc;n của một h&atilde;ng m&aacute;y t&iacute;nh ở H&agrave; Nội, vợ chồng anh chị đang ngắm ngh&iacute;a căn hộ 2 ph&ograve;ng ngủ của Park 5. Chị Hồng cho biết: &ldquo;Căn hộ vợ chồng ch&uacute;ng t&ocirc;i ưng &yacute; c&oacute; mức gi&aacute; 2,4 tỷ. Ch&uacute;ng t&ocirc;i đ&atilde; t&iacute;ch c&oacute;p được khoảng 700 triệu, với bảng lương ổn định của hai vợ chồng, ng&acirc;n h&agrave;ng Techcombank đ&atilde; sẵn s&agrave;ng giải ng&acirc;n 100% ở ngay đợt nộp tiền thứ 2&rdquo;.&nbsp;</p>\r\n\r\n<p>Theo thống k&ecirc; của Đất Xanh Miền Bắc, đơn vị ph&acirc;n phối độc quyền dự &aacute;n, nhờ ch&iacute;nh s&aacute;ch vay ưu việt n&ecirc;n nhiều kh&aacute;ch h&agrave;ng c&oacute; khả năng t&agrave;i ch&iacute;nh đ&atilde; chuyển từ việc thanh to&aacute;n trực tiếp theo tiến độ dự &aacute;n sang h&igrave;nh thức vay Techcombank để được hưởng ch&iacute;nh s&aacute;ch ưu đ&atilde;i. Theo ch&iacute;nh s&aacute;ch n&agrave;y, kh&aacute;ch vay mua căn hộ Park 5 sẽ được hưởng l&atilde;i suất 0% khi thanh to&aacute;n trước hạn, kh&ocirc;ng chỉ c&oacute; thế, kh&aacute;ch h&agrave;ng c&ograve;n được Techcombank tặng tiền mặt số tiền bằng 3%/năm cho 70% gi&aacute; trị căn hộ, trong thời gian từ thời điểm giải ng&acirc;n sớm đến thời điểm thanh to&aacute;n từng đợt theo tiến độ ban đầu tr&ecirc;n HĐMB. Số tiền tặng lại n&agrave;y l&ecirc;n tới 2% tổng gi&aacute; trị căn hộ. Ngo&agrave;i ra, trong thời hạn 24 th&aacute;ng kể từ ng&agrave;y ng&acirc;n h&agrave;ng giải ng&acirc;n, nếu kh&aacute;ch h&agrave;ng c&oacute; đủ t&agrave;i ch&iacute;nh v&agrave; muốn tất to&aacute;n khoản vay th&igrave; sẽ kh&ocirc;ng bị chịu ph&iacute; phạt trả nợ trước hạn.&nbsp;</p>\r\n\r\n<p>Trong bối cảnh bất động sản bắt đầu c&oacute; những chuyển biến khởi sắc đồng thời với đ&agrave; ổn định v&agrave; ph&aacute;t triển của kinh tế vĩ m&ocirc;, động th&aacute;i ưu đ&atilde;i cho vay bất động sản của c&aacute;c ng&acirc;n h&agrave;ng đ&atilde; k&iacute;ch th&iacute;ch c&aacute;c kh&aacute;ch h&agrave;ng c&aacute; nh&acirc;n vay vốn mua nh&agrave;, mua căn hộ để ở.</p>\r\n\r\n<table align=\"center\" cellpadding=\"3\" cellspacing=\"3\" style=\"border:0px; margin:auto; vertical-align:middle; width:530px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:rgb(186, 226, 237); vertical-align:middle\"><strong>Một số th&ocirc;ng tin về Vinhomes Times City &ndash; Park Hill:</strong><br />\r\n			<br />\r\n			&diams;&nbsp; &nbsp; Tổng diện t&iacute;ch đất: 74.204m2<br />\r\n			&diams;&nbsp; &nbsp; Tỉ lệ diện t&iacute;ch d&agrave;nh cho cảnh quan: Tr&ecirc;n 70%<br />\r\n			&diams;&nbsp;&nbsp; &nbsp;Giải thưởng: &quot;Dự &aacute;n phức hợp tốt nhất&quot; &amp; &quot;Trung t&acirc;m thương mại tốt nhất&quot;- Hai trong số những hạng mục danh gi&aacute; nhất tại giải thưởng bất động sản Ch&acirc;u &Aacute; - Th&aacute;i B&igrave;nh Dương&nbsp;<br />\r\n			&diams;&nbsp; &nbsp; Thiết kế căn hộ hiện đại, đẳng cấp, tối ưu h&oacute;a về diện t&iacute;ch v&agrave; c&ocirc;ng năng sử dụng<br />\r\n			&diams;&nbsp; &nbsp; To&agrave;n bộ c&aacute;c ph&ograve;ng trong căn hộ đều c&oacute; khe s&aacute;ng/mặt tho&aacute;ng để đ&oacute;n gi&oacute; v&agrave; &aacute;nh s&aacute;ng tự nhi&ecirc;n. T&ograve;a Park 5 ở vị tr&iacute; nh&igrave;n ra c&ocirc;ng vi&ecirc;n Y&ecirc;n Sở, hệ thống hồ tự nhi&ecirc;n, s&ocirc;ng Hồng v&agrave; nội khu<br />\r\n			&diams;&nbsp; &nbsp; Khu thể thao ngo&agrave;i trời, s&acirc;n b&oacute;ng rổ, s&acirc;n chơi s&aacute;ng tạo, d&atilde;y nh&agrave; phố thương mại<br />\r\n			&diams;&nbsp; &nbsp; Chương tr&igrave;nh ưu đ&atilde;i&nbsp;<strong>&ldquo;Mua nh&agrave; liền tay, tặng ngay l&atilde;i suất&rdquo;</strong><br />\r\n			&nbsp; &nbsp;&bull;&nbsp;Sở hữu ngay căn hộ mơ ước chỉ với 30% gi&aacute; trị căn hộ<br />\r\n			&nbsp; &nbsp;&bull;&nbsp;Thanh to&aacute;n gi&aacute; trị căn hộ c&ograve;n lại sau 24 th&aacute;ng<br />\r\n			&nbsp; &nbsp;&bull;&nbsp;Miễn ph&iacute; trả nợ trước hạn trong v&ograve;ng 24 th&aacute;ng<br />\r\n			&nbsp; &nbsp;&bull;&nbsp;Nhận qu&agrave; tặng tiền mặt từ Techcombank l&ecirc;n đến 2% gi&aacute; trị căn hộ<br />\r\n			&nbsp; &nbsp;&bull;&nbsp;Được Techcombank đảm bảo nghĩa vụ b&agrave;n giao nh&agrave; của Chủ đầu tư</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><em>Mọi chi tiết xin vui l&ograve;ng li&ecirc;n hệ:</em><br />\r\nC&ocirc;ng ty CP Dịch vụ v&agrave; Địa ốc Đất Xanh Miền Bắc<br />\r\nHotline: 0914 42 91 91 &ndash; 0946 80 91 91</p>\r\n</div>\r\n\r\n<div class=\"detailsView-contents-style soucenews\" id=\"ctl28_ctl00_divSourceNews\" style=\"font-family: Tahoma; margin: 0px; padding: 10px; height: auto; word-wrap: break-word; text-align: right; color: rgb(0, 0, 0); line-height: 18px;\"><em>(Theo Đất Xanh Miền Bắc)</em>&nbsp;</div>\r\n', NULL, '', 'http://file4.batdongsan.com.vn/2015/06/04/wxbwknn6/20150604170346-9828.jpg', '', 0, 'Chính sách tín dụng bất động sản đang từng bước mở ra cơ hội cho người mua nhà. Các ngân hàng đang tích cực đưa ra các chương trình, các gói kích cầu nhằm thu hút các đối tượng khách hàng có thu nhập ổn định, đồng thời đẩy mạnh vốn vào phân khúc này với lãi suất ưu đãi nhằm đón đầu xu hướng mua nhà để ở đang gia tăng.', 'tintuc', 406, 879, NULL, 0, 0, 'uu-dai-hap-dan-chi-tu-540-trieu-da-co-the-so-huu-can-ho-park-5', '', NULL, NULL),
(41, 'Dresden trở thành \"điểm nóng\" mới của bất động sản Đức', NULL, '2015-06-08 20:14:41', '2019-02-28 14:10:27', '2015-06-08 20:13:43', 'true', '<div class=\"detailsView-contents-style detail-article-content\" id=\"divContents\" style=\"font-family: Tahoma; margin: 10px 0px 0px; padding: 0px; height: auto; word-wrap: break-word; text-align: justify; line-height: 18px; text-rendering: optimizeLegibility; color: rgb(0, 0, 0);\">\r\n<p>TP. Dresden l&agrave; thủ phủ của bang Saxony, c&aacute;ch Thủ đ&ocirc;&nbsp;Berlin 200km (125 dặm) về ph&iacute;a Nam. Hiện thị trường BĐS&nbsp;ở TP n&agrave;y đang bước v&agrave;o kỳ b&ugrave;ng nổ khi c&aacute;c c&ocirc;ng ty BĐS&nbsp;của Đức mở rộng hoạt động tới đ&acirc;y sau cuộc khủng hoảng t&agrave;i ch&iacute;nh to&agrave;n cầu. C&ocirc;ng ty Nghi&ecirc;n cứu Bulwiengesa cho biết, trong 5 năm qua, gi&aacute; căn hộ mới x&acirc;y tại TP n&agrave;y đ&atilde;&nbsp;tăng 47%, vượt xa mức trung b&igrave;nh to&agrave;n quốc l&agrave; 30% v&agrave; tại Berlin l&agrave; 33%.</p>\r\n\r\n<p>&ldquo;Hiện&nbsp;gi&aacute; nh&agrave; đất ở Munich, Berlin v&agrave;&nbsp;Hamburg&nbsp;được đ&aacute;nh gi&aacute;&nbsp;l&agrave; qu&aacute; đắt đỏ. V&igrave; vậy, c&aacute;c nh&agrave; đầu tư đang t&igrave;m kiếm v&agrave; đầu tư&nbsp;ở những TP mới v&agrave; Dresden c&oacute; đầy đủ tiềm năng để ph&aacute;t triển&rdquo;, Ronald Fiedler, người đứng đầu cơ quan nghi&ecirc;n cứu, thăm d&ograve; BĐS&nbsp;Engel &amp; Voelkers tại Berlin cho hay.</p>\r\n\r\n<p>Sau chiến tranh thế giới lần&nbsp;thứ II, c&aacute;c trung t&acirc;m lịch sử bao quanh Nh&agrave; thờ Đức Mẹ của TP đ&atilde; được x&acirc;y dựng lại từ&nbsp;đống đổ n&aacute;t. Việc trẻ h&oacute;a c&aacute;c c&ocirc;ng tr&igrave;nh đ&atilde; gi&uacute;p TP. Dresden lấy lại biệt danh của m&igrave;nh trước chiến tranh l&agrave;&nbsp;&ldquo;Florence của Elbe&rdquo;, bởi c&aacute;c m&aacute;i v&ograve;m v&agrave; c&aacute;c ngọn th&aacute;p tr&ocirc;ng&nbsp;như một bức tranh thơ mộng b&ecirc;n d&ograve;ng s&ocirc;ng Elbe.</p>\r\n\r\n<table align=\"center\" style=\"border:0px; margin:auto; vertical-align:middle; width:250px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle\"><em><img alt=\"thị trường BĐS Đức\" src=\"http://file4.batdongsan.com.vn/2015/06/08/skfAIqGF/20150608105042-8bdf.jpg\" style=\"height:365px; margin:0px; padding:0px; width:600px\" title=\"Dresden trở thành &quot;điểm nóng&quot; mới của bất động sản Đức \" /></em></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; vertical-align:middle\"><em>TP. Dresden đang trở th&agrave;nh &quot;điểm n&oacute;ng&quot; mới của thị trường BĐS Đức</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Mặc d&ugrave; c&oacute; mức tăng gi&aacute;&nbsp;mạnh v&agrave;&nbsp;thu h&uacute;t được d&ograve;ng tiền đầu tư lớn nhưng&nbsp;gi&aacute; của&nbsp;c&aacute;c căn hộ tại TP n&agrave;y vẫn&nbsp;chưa đắt lắm, ước t&iacute;nh v&agrave;o khoảng&nbsp;2.800 EUR/m2 (3.123 USD/m2). Đ&acirc;y được xem&nbsp;l&agrave; mức gi&aacute;&nbsp;phải chăng so với Berlin, nơi m&agrave; người ta đang phải trả tới 3.850 EUR/m2 v&agrave; rẻ hơn rất nhiều so với Hamburg v&agrave; Frankfurt l&agrave; 4.200 EUR/m2.</p>\r\n\r\n<p>Tập đo&agrave;n Volkswagen AG đ&atilde; x&acirc;y dựng một nh&agrave; m&aacute;y gần trung t&acirc;m TP, c&ograve;n ở v&ugrave;ng ngoại &ocirc; ph&iacute;a Bắc TP l&agrave; c&aacute;c nh&agrave; m&aacute;y chuy&ecirc;n sản xuất c&aacute;c loại chip xử l&yacute; th&ocirc;ng tin. Ng&agrave;nh c&ocirc;ng nghiệp vi mạch điện tử&nbsp;với 1.500 c&ocirc;ng ty đ&atilde; tuyển dụng hơn 48.000 người, gi&uacute;p TP n&agrave;y trở n&ecirc;n đ&ocirc;ng đ&uacute;c, nhộn nhịp v&agrave; th&uacute;c đẩy ng&agrave;nh BĐS&nbsp;c&agrave;ng ph&aacute;t triển nhanh.</p>\r\n\r\n<p>&ldquo;Dresden cũng giống như rất nhiều&nbsp;TP&nbsp;kh&aacute;c&nbsp;của Đức, được x&acirc;y dựng v&agrave; chuyển đổi lại cơ cấu th&agrave;nh c&ocirc;ng sau khi 2 miền thống nhất&rdquo;, &ocirc;ng Wolfgang Schaeuble,&nbsp;Bộ trưởng Bộ T&agrave;i ch&iacute;nh Đức&nbsp;cho biết.</p>\r\n\r\n<p>Tốc độ&nbsp;tăng trưởng kinh tế nhanh&nbsp;v&agrave; việc mở rộng c&aacute;c trường đại học, c&aacute;c c&ocirc;ng ty, tập đo&agrave;n lớn đ&atilde; th&uacute;c đẩy đầu tư lớn v&agrave;o ng&agrave;nh BĐS, nhất l&agrave; ph&acirc;n kh&uacute;c văn ph&ograve;ng, kh&aacute;ch sạn,&nbsp;trung t&acirc;m thương mại trong v&ograve;ng hơn 1 thập kỷ qua.</p>\r\n\r\n<p>Tổng gi&aacute;m đốc của TLG Immobilien AG, một c&ocirc;ng ty thương mại c&oacute; trụ sở tại Berlin cho biết, c&ocirc;ng ty hiện&nbsp;đang trong qu&aacute; tr&igrave;nh thương lượng để mua lại một số cửa h&agrave;ng b&aacute;n lẻ tại c&aacute;c TP lớn của Đức, trong đ&oacute; c&oacute; nhiều cửa h&agrave;ng tại Dresden nhằm&nbsp;giảm c&aacute;c chi ph&iacute; về gi&aacute; thu&ecirc; văn ph&ograve;ng đ&atilde; tăng rất cao, l&ecirc;n tới 13% trong 5 năm qua.</p>\r\n\r\n<p>&ldquo;TP. Dresden đang ph&aacute;t triển vượt bậc trong mọi lĩnh vực, đặc biệt&nbsp;l&agrave; gi&aacute;o dục. Nhiều trường đại học đ&atilde; được mở tại TP n&agrave;y, thu h&uacute;t nhiều người trẻ tuổi th&ocirc;ng minh, năng động tới đ&acirc;y học tập, lao động v&agrave; lập nghiệp. Những yếu tố n&agrave;y sẽ gi&uacute;p thị trường nh&agrave; đất&nbsp;nơi n&agrave;y ph&aacute;t triển&rdquo;, Niclas Karoff, một th&agrave;nh vi&ecirc;n trong Ban gi&aacute;m đốc TLG cho biết.</p>\r\n\r\n<p>Christian Falkenberg, Gi&aacute;m đốc điều h&agrave;nh Trung t&acirc;m Nghi&ecirc;n cứu v&agrave; ph&aacute;t triển BĐS&nbsp;Falkenberg &amp; Kakies chia sẻ: &ldquo;Ngo&agrave;i những t&ograve;a cao ốc v&agrave; chung cư mới kh&aacute; thu h&uacute;t giới trẻ, th&igrave; h&uacute;t&nbsp;kh&aacute;ch nhất phải kể đến những ng&ocirc;i nh&agrave; cổ với những gi&agrave;n d&acirc;y leo bao quanh nh&agrave; rất đẹp mắt. Với những ng&ocirc;i nh&agrave; đ&atilde;&nbsp;trải qua chiến tranh m&agrave; vẫn giữ nguy&ecirc;n vẹn n&eacute;t đẹp cổ k&iacute;nh, hầu như kh&ocirc;ng phải sửa chữa g&igrave; nhiều thường&nbsp;c&oacute; gi&aacute; rất cao v&agrave; kh&ocirc;ng bao giờ ế kh&aacute;ch&rdquo;.</p>\r\n\r\n<p>Tuy nhi&ecirc;n, cũng c&oacute; kh&ocirc;ng &iacute;t &yacute; kiến tỏ ra&nbsp;quan ngại về t&igrave;nh h&igrave;nh đầu tư BĐS&nbsp;đang tăng đột biến tại Dresden. Bernhard Kaluaza, Gi&aacute;m đốc của Kaluza Consult GmbH tại Dresden cho biết, nhiều người đ&atilde; đầu tư sai thời điểm v&agrave;o sau năm 1990 v&agrave; đ&atilde; mất nhiều&nbsp;t&agrave;i sản do gi&aacute; BĐS&nbsp;sau đ&oacute; đ&atilde; giảm đột ngột. Hiện nay, gi&aacute; nh&agrave; đất&nbsp;lại đang tăng mạnh v&agrave; t&ocirc;i c&oacute; đủ l&yacute; do để lo sợ về một thị trường &quot;bong b&oacute;ng&quot;.</p>\r\n\r\n<p>Trong những nh&agrave; đầu tư&nbsp;đang đổ tiền v&agrave;o Dresden, c&oacute; khoảng 80% l&agrave;&nbsp;đến từ T&acirc;y Đức, phần c&ograve;n lại l&agrave; c&aacute;c nh&agrave; đầu tư tới từ &Yacute; v&agrave;&nbsp;H&agrave; Lan. Fiedler dự đo&aacute;n, từ nay cho tới năm 2020, thị trường BĐS&nbsp;tại Dresden sẽ tiếp tục tăng 3% mỗi năm.</p>\r\n</div>\r\n\r\n<div class=\"detailsView-contents-style soucenews\" id=\"ctl28_ctl00_divSourceNews\" style=\"font-family: Tahoma; margin: 0px; padding: 10px; height: auto; word-wrap: break-word; text-align: right; color: rgb(0, 0, 0); line-height: 18px;\"><em>(Theo Đầu tư chứng kho&aacute;n Online)</em>&nbsp;</div>\r\n', NULL, '', 'http://file4.batdongsan.com.vn/2015/06/08/skfAIqGF/20150608105042-8bdf.jpg', '', 0, 'Các nhà đầu tư bất động sản (BĐS) Đức đang ngày càng chú ý hơn đến một thành phố ở phía Đông, nay đã trở thành một trong những thành phố lớn và sầm uất của nước Đức, đó chính là Dresden.', 'tintuc', 406, 940, NULL, 0, 0, 'dresden-tro-thanh-diem-nong-moi-cua-bat-dong-san-duc', '', NULL, NULL),
(43, 'THẬT KHÔNG THỂ TIN NỔI MUA CH PARK VIEW RESIDENCE TẶNG NGAY BPHONE VAY 30.000 TỶ LH 0945.148.500', 'TO BUY RESIDENCE PARK VIEW GIFT BPHONE AND LOAN 30.000 BILLION. CONTACT: 0945,148,500', '2015-06-08 20:16:30', '2019-02-28 14:24:28', '2015-06-08 20:15:33', 'true', '<div class=\"kqchitiet\" style=\"font-family: Tahoma; margin: 0px 0px 10px; padding: 0px; line-height: 22px; color: rgb(0, 0, 0);\"><strong>Khu vực:</strong>&nbsp;<a href=\"http://batdongsan.com.vn/ban-can-ho-chung-cu-park-view-residence\" style=\"font-size: 14px; margin: 0px; text-decoration: none; padding: 0px; color: rgb(5, 86, 153);\">B&aacute;n căn hộ chung cư tại Park View Residence</a>&nbsp;- Quận H&agrave; Đ&ocirc;ng - Hà N&ocirc;̣i<span class=\"gia-title mar-right-15\" style=\"font-size:14px\"><strong>Gi&aacute;:</strong>&nbsp;<strong>16.9 triệu/m&sup2;&nbsp;&nbsp;</strong></span><span class=\"gia-title\" style=\"font-size:14px\"><strong>Diện t&iacute;ch:</strong>&nbsp;<strong>57.49m&sup2;</strong></span></div>\n\n<div class=\"pm-mota\" style=\"font-family: Tahoma; margin: 0px 0px 5px; padding: 0px; color: rgb(142, 142, 142); font-weight: bold; line-height: 18px;\">Th&ocirc;ng tin m&ocirc; tả</div>\n\n<div class=\"pm-content stat\" style=\"font-family: Tahoma; font-size: 13px; margin: 0px; padding: 0px; color: rgb(0, 0, 0); line-height: 18px;\">Ceninvest ch&iacute;nh thức mở b&aacute;n lần đầu ti&ecirc;n t&ograve;a H Parkview Residence.<br />\nHiện nay ch&uacute;ng t&ocirc;i mở b&aacute;n lần đầu ti&ecirc;n t&ograve;a H l&agrave; t&ograve;a trung t&acirc;m đẹp nhất tiểu khu Parkview Residence.<br />\nGi&aacute; chỉ từ 16.9 tr/m2 (bao gồm VAT + full nội thất ho&agrave;n hảo).<br />\nHỗ trợ vay 30.000 tỷ với LS ưu đ&atilde;i 5%/ năm.<br />\nThật kh&ocirc;ng thể tin nổi tặng ngay điện thoại B Phone đẳng cấp nhất thế giới khi mua căn hộ Park View.<br />\nLh ngay trưởng ban quản l&yacute; dự &aacute;n Mr. Nguy&ecirc;n: 091.751.9876.<br />\nTrưởng ph&ograve;ng kinh doanh Mr. Đức: 0945.148.500.<br />\nL&yacute; do n&ecirc;n mua căn hộ tại dự &aacute;n Park View Residence:<br />\n- Dự &aacute;n nằm tại mặt đường&nbsp;<a href=\"http://batdongsan.com.vn/ban-can-ho-chung-cu-duong-le-van-luong-15\" style=\"font-size: 12px; margin: 0px; text-decoration: none; padding: 0px; color: rgb(5, 86, 153);\">L&ecirc; Văn Lương</a>&nbsp;k&eacute;o d&agrave;i &ndash; tuyến đường huyết mạch của th&agrave;nh phố, đường rộng tới 42m2.<br />\n- An ninh dự &aacute;n c&oacute; bảo vệ trực 24/24 ngo&agrave;i s&acirc;n, trong sảnh chờ, camera an ninh 24/24 khắp h&agrave;nh lang, sảnh nội bộ, cư d&acirc;n ra v&agrave;o sử dụng thẻ cư d&acirc;n ri&ecirc;ng.<br />\n- Dự &aacute;n c&oacute; bể bơi ngo&agrave;i trời chỉ phục vụ cho cư d&acirc;n của 3 t&ograve;a H J K của dự &aacute;n Park View.<br />\nTh&ocirc;ng tin dự &aacute;n.<br />\nT&ecirc;n dự &aacute;n: Tiểu khu Park View Residence.<br />\nChủ đầu tư v&agrave; ph&acirc;n phối trực tiếp sản phẩm: Tập Đo&agrave;n Cengroup.<br />\nVị tr&iacute;: KĐT mới Dương Nội &ndash; Q. H&agrave; Đ&ocirc;ng.<br />\nQuy m&ocirc;: 03 t&ograve;a th&aacute;p cao 25 tầng, 02 tầng hầm, 1 tầng thương mại.<br />\nDiện t&iacute;ch khu đất: 10.558m2.<br />\nDiện t&iacute;ch x&acirc;y dựng: 8.425m2.<br />\nMật độ x&acirc;y dựng: 26.6%.<br />\nTầng hầm: 02 tầng.<br />\nTổng số căn hộ: 627 căn.<br />\nTiến độ b&agrave;n giao: Qu&yacute; 3/2016.<br />\n<br />\nVị tr&iacute; dự &aacute;n.<br />\nChung cư Park View Residence Dương Nội tọa lạc tại vị tr&iacute; đắc địa, nằm ngay tr&ecirc;n trục đường L&ecirc; Văn Lương k&eacute;o d&agrave;i:<br />\n+ Ph&iacute;a Đ&ocirc;ng Nam: Gi&aacute;p đường Tố Hữu, nh&igrave;n sang khu đ&ocirc; thị Park City.<br />\n+ Ph&iacute;a Bắc: Khớp nối hạ tầng với khu Thương Mại &ndash; Du Lịch &ndash; Văn H&oacute;a v&agrave; đ&ocirc; thị mới ph&iacute;a T&acirc;y H&agrave; Nội.<br />\n<br />\nHạ tầng cơ sở.<br />\n+ Chung cư Dương Nội thiết kế 02 tầng hầm li&ecirc;n th&ocirc;ng 10 T&ograve;a đ&aacute;p ứng tr&ecirc;n 1.000 chỗ để &ocirc; t&ocirc;, với hệ thống quản l&yacute; th&ocirc;ng minh;<br />\n+ Diện t&iacute;ch thảm xanh v&agrave; giao th&ocirc;ng nội bộ l&ecirc;n tới 25.831 m2.<br />\n+ Hệ thống trường mầm non đạt chuẩn chất lượng;<br />\n+ Ph&ograve;ng tập gym Fitness hiện đại;<br />\n+ Hệ thống camera gi&aacute;m s&aacute;t 24/24 đảm bảo kiểm so&aacute;t an ninh tuyệt đối.<br />\n<br />\nDiện t&iacute;ch căn hộ.<br />\n+ Căn hộ 2 ph&ograve;ng ngủ: 57,49m2 &ndash; 65,8m2 - 72,2m2.<br />\n+ Căn hộ 3 ph&ograve;ng ngủ: 111,82 m2.<br />\n<br />\nGi&aacute; b&aacute;n.<br />\n+ Gi&aacute; b&aacute;n từ 16.9 triệu/m2 (VAT + Nội thất ho&agrave;n thiện).<br />\n<br />\nTiến độ thanh to&aacute;n.<br />\nĐợt 1: Thanh to&aacute;n 30% gi&aacute; trị căn hộ khi k&yacute; HĐMB.<br />\nĐợt 2: Thanh to&aacute;n 10% gi&aacute; trị căn hộ khi đổ b&ecirc; t&ocirc;ng x&acirc;y dựng xong s&agrave;n tầng 5 dự kiến 11/05/2015.<br />\nĐợt 3: Thanh to&aacute;n 15% gi&aacute; trị căn hộ khi đổ b&ecirc; t&ocirc;ng x&acirc;y dựng xong s&agrave;n tầng 15 dự kiến 30/07/2015.<br />\nĐợt 4: Thanh to&aacute;n 15% gi&aacute; trị căn hộ khi đổ b&ecirc; t&ocirc;ng x&acirc;y dựng xong s&agrave;n tầng 25(cất n&oacute;c) dự kiến 20/10/2015.<br />\nĐợt 5: Thanh to&aacute;n 10% gi&aacute; trị căn hộ khi x&acirc;y tường v&agrave; tr&aacute;t của t&ograve;a nh&agrave; đến tầng 25 dự kiến 20/12/2015.<br />\nĐợt 6: Thanh to&aacute;n 10% gi&aacute; trị căn hộ khi khi ho&agrave;n thiện cửa k&iacute;nh v&agrave; sơn mặt ngo&agrave;i t&ograve;a nh&agrave; dự kiến 20/01/2016.<br />\nĐợt 7: Thanh to&aacute;n 10% gi&aacute; trị căn hộ v&agrave; 2% ph&iacute; bảo tr&igrave; khi b&agrave;n giao căn hộ.<br />\n<br />\nMọi chi tiết về căn hộ Park View Residence KĐT Dương Nội Qu&yacute; kh&aacute;ch h&agrave;ng li&ecirc;n hệ trực tiếp chủ đầu tư.<br />\nTrưởng ban quản l&yacute; dự &aacute;n Mr. Nguy&ecirc;n: 091.751.9876.<br />\nTrưởng ph&ograve;ng kinh doanh Mr. Đức: 0945.148.500.</div>\n', '', '', 'http://file4.batdongsan.com.vn/resize/745x510/2015/05/26/rkC70Ljn/20150526172219-f5c4.jpg', '', 0, 'Ceninvest chính thức mở bán lần đầu tiên tòa H Parkview Residence.. Hiện nay chúng tôi mở bán lần đầu tiên tòa H là tòa trung tâm đẹp nhất tiểu khu Parkview Residence.. Giá chỉ từ 16.9 tr/m2 (bao gồm VAT + full nội thất hoàn hảo).. Hỗ trợ vay 30.000 ...', 'tintuc', 407, 720, NULL, 0, 0, 'that-khong-the-tin-noi-mua-ch-park-view-residence-tang-ngay-bphone-vay-30000-ty-lh-0945148500', '', NULL, 'Ceninvest officially sale a first block H Parkview Residence H .. Now we open the first sale Building H is the most beautiful building subregional centers Parkview Residence .. Price only from 16.9 pg / m2 (including VAT + full perfect interior) .. Suppor'),
(44, 'CĂN HỘ CHUNG CƯ ROYAL CITY - ĐÓNG 30% NHẬN NHÀ NGAY - CƠ HỘI ĐẦU TƯ SINH LỜI TỚI 20%/NĂM', 'ROYAL CITY APARTMENT - THE PAYMENT RECEIVED 30% - OPPORTUNITIES TO GROW 20% / YEAR', '2015-06-08 20:17:12', '2019-02-28 14:24:50', '2015-06-08 20:16:33', 'true', '<div class=\"kqchitiet\" style=\"font-family: Tahoma; margin: 0px 0px 10px; padding: 0px; line-height: 22px; color: rgb(0, 0, 0);\"><strong>Khu vực:</strong>&nbsp;<a href=\"http://batdongsan.com.vn/ban-can-ho-chung-cu-royal-city\" style=\"font-size: 14px; margin: 0px; text-decoration: none; padding: 0px; color: rgb(5, 86, 153);\">B&aacute;n căn hộ chung cư tại Royal City</a>&nbsp;- Quận Thanh Xu&acirc;n - Hà N&ocirc;̣i&nbsp;<span class=\"gia-title mar-right-15\" style=\"font-size:14px\"><strong>Gi&aacute;:</strong>&nbsp;<strong>3.7 tỷ&nbsp;&nbsp;</strong></span><span class=\"gia-title\" style=\"font-size:14px\"><strong>Diện t&iacute;ch:</strong>&nbsp;<strong>93m&sup2;</strong></span></div>\n\n<div class=\"pm-mota\" style=\"font-family: Tahoma; margin: 0px 0px 5px; padding: 0px; color: rgb(142, 142, 142); font-weight: bold; line-height: 18px;\">Th&ocirc;ng tin m&ocirc; tả</div>\n\n<div class=\"pm-content stat\" style=\"font-family: Tahoma; font-size: 13px; margin: 0px; padding: 0px; color: rgb(0, 0, 0); line-height: 18px;\">Holine: 0905 974 688/ 0916 957 688 (Ms Mai Khanh).<br />\nAdd: S&agrave;n Giao dịch Bất động sản R4 Royal city.<br />\nWebsite: Http://vinhomeroyalcity.com Từ ng&agrave;y 25/4/2015, Chủ đầu tư Vingruop đ&atilde; đưa ra chương tr&igrave;nh ưu đ&atilde;i cực kỳ hấp dẫn, &aacute;p dụng cho tất cả c&aacute;c kh&aacute;ch mua căn hộ từ R1-R5. Đ&acirc;y l&agrave; cơ hội đặc biệt cho những kh&aacute;ch h&agrave;ng y&ecirc;u mến khu căn hộ Ho&agrave;ng Gia tạo dựng cuộc sống vương giả v&agrave; sinh lời.<br />\nCH&Iacute;NHS&Aacute;CH B&Aacute;N H&Agrave;NG:<br />\n1. D&agrave;nh cho kh&aacute;ch h&agrave;ng đầu tư:<br />\n- Chỉ cần đ&oacute;ng 30% gi&aacute; trị căn hộ, kh&aacute;ch h&agrave;ng được nhận nh&agrave; ngay. 70% c&ograve;n lại được ng&acirc;n h&agrave;ng &acirc;n hạn to&agrave;n bộ nợ gốc v&agrave; miễn ph&iacute; to&agrave;n bộ l&atilde;i vay+ miễn ph&iacute; l&atilde;i trả nợ trước hạn cho kh&aacute;ch h&agrave;ng trong v&ograve;ng từ 12 đến 18 th&aacute;ng.<br />\n- Chủ đầu tư cam kết thu&ecirc; lại căn hộ trong thời gian 2 năm với số tiền thu&ecirc; l&ecirc;n tới 50 triệu/căn.<br />\nVới căn hộ trị gi&aacute; 4 tỷ, kh&aacute;ch h&agrave;ng chỉ phải đầu tư 1,2 tỷ. Ngay trong năm đầu đ&atilde; thu về số tiền thu&ecirc; l&agrave; 18,000,000 vnd/th&aacute;ng (216 triệu/năm)=&gt;L&atilde;i suất tương đương 20%/năm (Đầu tư si&ecirc;u lợi nhuận).<br />\n<br />\nNgo&agrave;i ra, thị trường bất động sản đang dậy s&oacute;ng, nguồn cung căn hộ cao cấp trong nội đ&ocirc; đang cạn dần (Ở Royal city đ&acirc;y l&agrave; đợt b&aacute;n h&agrave;ng cuối c&ugrave;ng, cuối năm 2015 sẽ hết sạch nguồn cung). Với gi&aacute; b&aacute;n của c&aacute;c căn hộ Royal city ch&uacute;ng t&ocirc;i đang ph&acirc;n phối l&agrave; từ 34 triệu- 40 triệu/m2 (đ&atilde; c&oacute; VAT v&agrave; ph&iacute; Bảo tr&igrave;). Khả năng tăng gi&aacute; của căn hộ trong tương lai l&agrave; rất cao. V&igrave; vậy, đấy ch&iacute;nh l&agrave; cơ hội đầu tư sinh lời thứ hai.<br />\nL&agrave; &ldquo;cơ hội đầu tư, sinh ba lợi &iacute;ch&rdquo; của kh&aacute;ch h&agrave;ng.<br />\n<br />\n2. D&agrave;nh cho kh&aacute;ch h&agrave;ng nhận nh&agrave; ở ngay:<br />\n- Đ&oacute;ng 30% gi&aacute; trị căn hộ nhận nh&agrave; ở ngay. Miễn ph&iacute; to&agrave;n bộ l&atilde;i vay v&agrave; &acirc;n hạn nợ gốc trong 12- 18 th&aacute;ng.<br />\n- Miễn ph&iacute; tiền sửa chữa căn hộ (đối với 8 loại căn hộ ở t&ograve;a R4, R5 v&agrave; 9 loại căn hộ ở t&ograve;a R1 v&agrave; R2) với c&aacute;c thiết kế mới cực đẹp, khắc phục được c&aacute;c điểm hạn chế trước đ&acirc;y của c&aacute;c căn hộ.<br />\n<br />\n=&gt;Cơ hội sở hữu căn hộ Ho&agrave;ng Gia, thể hiện &ldquo;đẳng cấp cuộc sống vượt trội&rdquo; trong tầm tay.<br />\n<br />\nVIETHOUSING TRỰC TIẾP PH&Acirc;N PHỐI hơn 600 căn hộ Royal city ở c&aacute;c t&ograve;a R1-R2-R3-R4-R5. VỚI C&Aacute;C ƯU Đ&Atilde;I ĐẶC BIỆT TỪ CHỦ ĐẦU TƯ.<br />\nTHAM KHẢO GI&Aacute; B&Aacute;N V&Agrave; GI&Aacute; CHO THU&Ecirc; CỦA 1 SỐ CĂN HỘ T&Ograve;A R1 V&Agrave; R2.<br />\nCăn 02: Diện t&iacute;ch 177m2 (G&oacute;c 3PN)- Gi&aacute; b&aacute;n 7,6 tỷ- Gi&aacute; thu&ecirc;: 324,000,000 đ/năm.<br />\nCăn 04: Diện t&iacute;ch 107m2 (2PN đẹp)- Gi&aacute; b&aacute;n 4,1 tỷ- Gi&aacute; thu&ecirc;: 180,000,000 đ/năm.<br />\nCăn 06: Diện t&iacute;ch 107m2 (2PN đẹp)- Gi&aacute; b&aacute;n 4,1 tỷ- Gi&aacute; thu&ecirc;: 180,000,000 đ/năm.<br />\nCăn 06B: Diện t&iacute;ch 177m2 (G&oacute;c 3PN)- Gi&aacute; b&aacute;n 7,6 tỷ- Gi&aacute; thu&ecirc;: 324,000,000 đ/năm.<br />\nCăn 08: Diện t&iacute;ch 111m2 (2PN tho&aacute;ng đẹp)- Gi&aacute; b&aacute;n 4,5 tỷ- Gi&aacute; thu&ecirc;: 192,000,000 đ/năm.<br />\nCăn 10: Diện t&iacute;ch 109.4m2 (2PN tho&aacute;ng)- Gi&aacute; b&aacute;n 4,2 tỷ- Gi&aacute; thu&ecirc;: 192,000,000 đ/năm.<br />\nCăn 12B: Diện t&iacute;ch 104m2 (2PN)- Gi&aacute; b&aacute;n 3,98 tỷ- Gi&aacute; thu&ecirc;: 180,000,000 đ/năm.<br />\nCăn 16: Diện t&iacute;ch 130,7m2 (3PN đẹp)- Gi&aacute; b&aacute;n 4,5 tỷ- Gi&aacute; thu&ecirc;: 216,000,000 đ/năm.<br />\nCăn 17: Diện t&iacute;ch 164m2 (3PN)- Gi&aacute; b&aacute;n 5,5 tỷ- Gi&aacute; thu&ecirc;: 288,000,000 đ/năm.<br />\nCăn 19: Diện t&iacute;ch 133m2 (3PN)- Gi&aacute; b&aacute;n 5,0 tỷ- Gi&aacute; thu&ecirc;: 264,000,000 đ/năm.<br />\nCăn 21: Diện t&iacute;ch 131m2 (3PN vu&ocirc;ng đẹp)- Gi&aacute; b&aacute;n 5,0 tỷ- Gi&aacute; thu&ecirc;: 264,000,000 đ/năm.<br />\nCăn 22: Diện t&iacute;ch 110m2 (2PN)- Gi&aacute; b&aacute;n 4,05 tỷ- Gi&aacute; thu&ecirc;: 216,000,000 đ/năm.<br />\nCăn 23: Diện t&iacute;ch 113,9m2 (3PN)- Gi&aacute; b&aacute;n 4,2 tỷ- Gi&aacute; thu&ecirc;: 204,000,000 đ/năm.<br />\nCăn 25: Diện t&iacute;ch 151,7m2 (3PN đẹp)- Gi&aacute; b&aacute;n 5,6 tỷ- Gi